const sec2 = ({contents})=>{
    return(
        <ul>
            {contents.map((content)=>
                <li>
                    <h2>{contents.tit}</h2>
                    <p>{contents.txt}</p>
                    <img src={contents.img}/>
                </li>
            )}
        </ul>
    )
}
export default sec2;
